import Vue from 'vue'
import App from './App.vue'
import Vuetify from 'vuetify'
import webpack from 'webpack-sources'
import 'vuetify/dist/vuetify.min.css'

Vue.use(Vuetify);

Vue.config.productionTip = false;


new Vue({
  render: h => h(App),
}).$mount('#app');

new webpack.ProvidePlugin({
  $: 'jquery',
  jQuery: 'jquery'
});
